import React from "react";
import {Route, Switch} from "react-router-dom";

const App = ({match}) => (
  <div className="gx-main-content-wrapper">
    <Switch>
      <Route path={`${match.url}`} component={null}/>
      <Route path={`${match.url}public`} component={null}/>
    </Switch>
  </div>
);

export default App;
